import React from 'react';

export default function DatePickers({inputType, id, placeholder, label, name, value, onChange, requi}) {
  return (
    <div>
      <label for="formGroupExampleInput2" class="form-label">{label}</label>
      <input
        type={inputType}
        class="form-control"
        id={id}
        placeholder={placeholder}
        name={name}
        value={value}
        onChange={onChange}
      />
    </div>
  );
}
